import React, {Component} from 'react';

class Nutslide extends Component {
    render() {
        return (
            <div className="nextslide">
                <ul>
                    <li className="isactive">1</li>
                    <li>2</li>
                    <li>3</li>
                </ul>
            </div>
        );
    }
}

export default Nutslide;
